import React, {Component} from 'react';
import MultipleSelect from "./reusableComponents/utils/MultipleItems";
import FlightServices from "../services/FlightServices";

class MainPage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            dataFromApi:[]
        }
    }

    componentDidMount() {
        FlightServices.getArrivalFlight().then((response => {
            this.setState({dataFromApi:response.data})
        }))
    }

    render() {
        return (
            <div className="container">
                <h2>Some main page</h2>
                <MultipleSelect dataApi={this.state.dataFromApi} />
            </div>
        );
    }
}

export default MainPage;
